import React from "react";

const Navbar = () => {
  return (
    <header id="main-navbar">
      <h1 id="title">Kronikea</h1>
      <nav className="main-nav">
        <ul>
          <li className="active">Home</li>
          <li>Profile</li>
          <li>Stories</li>
          <li>Characters</li>
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
